import React from 'react';
import { Navigate } from 'react-router-dom'
import Button from '@material-ui/core/Button';

class Login extends React.Component {

    constructor(props) {
        super(props);
        this.login = this.login.bind(this);
    }

    async login() {
        // acquire ThirdPartyToken and save to localStorage
        console.log('Login Baby')
        localStorage.setItem('third-party-token', 'abcdef')
    }

    render() {
        // attempt to retrieve CruiserToken if ThirdPartyToken acquired
        // redirect to home page if CruiserToken
        return (
            <div>
                <h2>Login Page</h2>
                <Button
                    variant='contained'
                    onClick={this.login}
                >Login to "Google"</Button>
            </div>
        )
    }
}

export default Login;
